import React from 'react';
import './Footer.css';
import img from '../../../src/TOS.jpg'

const Footer = () => {
    return ( 
        <footer className="footer">
            <br></br>
            <br></br>
            <br></br>
            <image src={img} alt="Dwyer"/>
            <br></br>
            <br></br>
            <br></br>
        </footer>
     );
}

export default Footer;
